defined('_JEXEC') or die;

$app = JFactory::getApplication();
$doc = JFactory::getDocument();
$user = JFactory::getUser();
$this->language = $doc->language;
$this->direction = $doc->direction;

// Getting params from template
$params = $app->getTemplate(true)->params;

if ($params->get('compile_sass', '0') === '1')
{
	require_once "includes/sass.php";
}

// Detecting Active Variables
$option = $app->input->getCmd('option', '');
$view = $app->input->getCmd('view', '');
$layout = $app->input->getCmd('layout', '');
$task = $app->input->getCmd('task', '');
$itemid = $app->input->getCmd('Itemid', '');
$sitename = $app->get('sitename');
$page = JRequest::getCmd('page');
//$pageclass = $params->get('pageclass_sfx');
$menuactive = $app->getMenu()->getActive();
$menu = $app->getMenu();

$pageclass = '';
if (is_object($menuactive))
    $pageclass = $menuactive->params->get('pageclass_sfx'); 


if ($task == "edit" || $layout == "form") {
    $fullWidth = 1;
} else {
    $fullWidth = 0;
}

// Check if front page
//$menu = $app->getMenu();
$isFrontPage="0";
if ($menu->getActive() == $menu->getDefault()) {
	$isFrontPage="1";
}

// DETECT K2 & K2 Categories


if ($option == "com_k2" && $view == "item")
{
	$K2Itemid = JRequest::getInt('id');
	$db = JFactory::getDBO();
	$db->setQuery("SELECT catid FROM #__k2_items WHERE id = ".$K2Itemid);
	$K2Catid = $db->loadResult();
	$k2Class = "category-".$K2Catid;

}
else
{
	$k2Class = "not-k2";
}

// Add Stylesheets
$doc->addStyleSheet($this->baseurl . '/templates/' . $this->template . '/css/template.css');

// Add scripts
JHtml::_('jquery.framework');
$doc->addScript($this->baseurl . '/templates/' . $this->template . '/js/popper.min.js');
$doc->addScript($this->baseurl . '/templates/' . $this->template . '/js/bootstrap.min.js');
$doc->addScript($this->baseurl . '/templates/' . $this->template . '/js/parallax-background.min.js');
$doc->addScript($this->baseurl . '/templates/' . $this->template . '/js/template.js');

// Adjusting content width
if ($this->countModules('sidebar-left') && $this->countModules('sidebar-right')) {
    $span = "col-md-4";
} elseif ($this->countModules('sidebar-left') && !$this->countModules('sidebar-right')) {
    $span = "col-md-8";
} elseif (!$this->countModules('sidebar-left') && $this->countModules('sidebar-right')) {
    $span = "col-md-8";
} else {
    $span = "col-md-12";
}
